import React, { useLocation } from 'react';
import AdminNavBar from './admin/AdminNavBar';

function AdminHome() {
  const location = useLocation();
  const { adminLoggedIn } = location.state || {};

  return (
    <div className="App">
      {adminLoggedIn && <AdminNavBar />}
      {/* other components */}
    </div>
  );
}

export default AdminHome;
